gap::generator<NamedDecl> TemplateParameterList::parameters(void) const {
  auto list = impl->reader.getVal11();
  for (auto v : list) {
    EntityId id(v);
    if (auto d11 = impl->ep->DeclFor(impl->ep, v)) {
      if (auto e = NamedDecl::from(Decl(std::move(d11)))) {
        co_yield std::move(*e);
      }
    }
  }
  co_return;
}

