std::optional<File> IncludeLikeMacroDirective::included_file(void) const {
  if (true) {
    RawEntityId eid = impl->reader.getVal9();
    if (eid == kInvalidEntityId) {
      return std::nullopt;
    }
    if (auto eptr = impl->ep->FileFor(impl->ep, eid)) {
      return File(std::move(eptr));
    }
  }
  return std::nullopt;
}

