gap::generator<Expr> AtomicExpr::sub_expressions(void) const {
  auto list = impl->reader.getVal15();
  for (auto v : list) {
    EntityId id(v);
    if (auto d15 = impl->ep->StmtFor(impl->ep, v)) {
      if (auto e = Expr::from(Stmt(std::move(d15)))) {
        co_yield std::move(*e);
      }
    }
  }
  co_return;
}

